import { Component } from '@angular/core';
import { LogstashService } from './logstash.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
  template: '<button (click)="log()">Log Message</button>'
})
export class AppComponent {
  title = 'Employee Management System';

  constructor(private logstashService: LogstashService) {}

  log(): void {
    this.logstashService.log('This is a log message from Angular.');
  }

}
<nav class="navbar navbar-expand-sm bg-primary navbar-dark">
  <ul class = "navbar-nav">
      <li class = "nav-item">
          <a routerLink="employees" routerLinkActive="active" class="nav-link">Employee List</a>
      </li>
      <li class = "nav-item">
          <a routerLink="create-employee" routerLinkActive="active" class="nav-link" >Add Employee</a>
      </li>
      <li class = "nav-item">
        <h3>{{title}}</h3>
    </li>
  </ul>
</nav>

<div class = "container">
  <router-outlet></router-outlet>
</div>
